!function(e) {
  "use strict";
  e("#skills .skill-bar").each(function() {
      var a = e(this).attr("data-width");
      e(this).addClass("skill-bar-" + a),
      e(this).find(".skill-tip").text(a + "%")
  }),
  e("#skill-dots .skill").each(function() {
      for (var a = e(this).find(".skill-progress").attr("data-score"), s = "", t = 0; t < a; t++)
          s += "<i class='fa active wow'></i>";
      for (t = a; t < 10; t++)
          s += "<i class='fa wow'></i>";
      e(this).find(".skill-progress").html(s)
  }),
  e(".button-group").each(function(a, s) {
      var t = e(s);
      t.on("click", "button", function() {
          t.find(".is-checked").removeClass("is-checked"),
          e(this).addClass("is-checked")
      })
  });
}(jQuery);
